create table tb_bilibili_user
(
    id             int auto_increment comment '自增ID'
        primary key,
    user_id        varchar(64)                         not null comment '用户ID',
    nickname       varchar(64)                         null comment '用户昵称',
    index_url      varchar(255)                        null comment '用户首页地址',
    avatar         varchar(255)                        null comment '用户头像地址',
    add_ts         bigint                              not null comment '记录添加时间戳',
    last_modify_ts bigint                              not null comment '记录最后修改时间戳',
    follows_count  varchar(16)                         null comment '关注数',
    fans_count     varchar(16)                         null comment '粉丝数',
    liked_count    varchar(16)                         null comment '获赞数',
    play_count     varchar(16)                         null comment '播放数',
    status         int       default 0                 null comment '任务状态',
    created_at     timestamp default CURRENT_TIMESTAMP null comment '最初入库时间',
    updated_at     timestamp default CURRENT_TIMESTAMP null on update CURRENT_TIMESTAMP comment '最后入库时间',
    constraint user_id
        unique (user_id)
)
    comment 'B站博主' charset = utf8mb4;

